import React from 'react'
import {Context} from '../Components/store/actions/appContext';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import {Link} from 'react-router-dom';
import logo from '../Media/proxylogo.jpeg';
import {useContext} from 'react';




function Header() {
  const {actions,store} = useContext(Context);

  return (
    <Navbar bg="dark" variant="dark">
        <Container>
          <Navbar.Brand href="#home" Link to='/'> <img src={logo} width="100" height="50"  alt='logo' />
</Navbar.Brand>
          <Nav className="me-auto">
            <Link to='/' className='nav-link'>Home</Link>
            <Link to='Register' className='nav-link'>Register</Link>
            <div> {store.token && store.token!= "" && store.token != undefined ? ("welcome to home page"
            ) : (


            <Link to='Login' className='nav-link'>Login</Link>
            )} 

            </div>
            <Link to='About' className='nav-link'>About</Link>
            <Link to='Gatepool' className='nav-link'>Gatepool</Link>
          </Nav>
        </Container>
      </Navbar>

  )
}
export default Header
